import { useParams } from "react-router-dom";
import Card from "../UI/Card";

const EmailDetails = () => {
  const params = useParams();
  return (
    <Card>
      <h1>Product Details</h1>
      <p>{params.productId}</p>
    </Card>
  );
};
export default EmailDetails;
